#include <iostream>
#include <stack>
#include <vector>

using namespace std;

class Solution
{
public:
    vector<int> dailyTemperatures1(vector<int> &temperatures)
    {
        stack<int> mem, out;

        for (int i = temperatures.size() - 1; i > -1; --i)
        {
            int j = i + 1;
            for(; j < temperatures.size(); j++){
                if(temperatures[j] > temperatures[i]) break;
            }

            if(j == temperatures.size()) out.push(0);
            else out.push(j - i);
        }

        vector<int> tmp;

        while (!out.empty())
        {
            tmp.push_back(out.top());
            out.pop();
        }

        return tmp;
    }

    vector<int> dailyTemperatures(vector<int> &temperatures)
    {
        stack<int> mem, out;

        for (int i = temperatures.size() - 1; i > -1; --i)
        {
            out.push(findNext(mem, i, temperatures));
        }

        vector<int> tmp;

        while (!out.empty())
        {
            tmp.push_back(out.top());
            out.pop();
        }

        return tmp;
    }

    int findNext(stack<int> &mem, int curr_i, const vector<int> &temps)
    {
        while (!mem.empty() && temps[mem.top()] <= temps[curr_i])
        {
            mem.pop();
        }

        if (mem.empty())
        {
            mem.push(curr_i);
            return 0;
        }
        else
        {
            int tmp = mem.top();
            mem.push(curr_i);
            return tmp - curr_i;
        }
    }
};

